import './App.css';
import NavBar from "./NavBar";
import ImgBanner from './ImgBanner';
import AboutUs from './AboutUs';
import Cabinet from './Cabinet';
import Events from './Events';
import Announcements from './Announcements';

function App() {
  return (
    <div className="App">
        <NavBar />
        <p className='welcome' id='Home'>Welcome to the North Penn Astronomy Club!</p>
        <ImgBanner />
        <AboutUs />
        <div id='News'>
          <Announcements />
        </div>
        <Cabinet/>
        <div id='Events'>
          <Events />
        </div>
    </div>
  );
}

export default App;
